import Login from "./components/Login.jsx";
import Register from "./components/Register.jsx";
import axios from "axios";

const BASE_API = "http://localhost:3001/";

function App(){

    return (
        <div className="login-screen">
            <h1>Welcome</h1>
            <div className="buttons-area">
                <h4>Please login/register to use our app</h4>
                <button onClick={handleOnClick} value="login">Login</button>
                <button onClick={handleOnClick} value="register">Register</button>
            </div>
        </div>
    )
}

export default App;
